import{_ as e,a as r,b as l}from"./chunks/pixhack_v5_debug.D1_dDAaI.js";import{_ as o,E as i,c as s,J as d,m as t,a as n,ab as h,o as p}from"./chunks/framework.CUflZczI.js";const C=JSON.parse('{"title":"CUAV v5 (Знято з виробництва)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/flight_controller/cuav_v5.md","filePath":"uk/flight_controller/cuav_v5.md"}'),c={name:"uk/flight_controller/cuav_v5.md"},u=t("h1",{id:"cuav-v5-знято-з-виробництва",tabindex:"-1"},[n("CUAV v5 (Знято з виробництва) "),t("a",{class:"header-anchor",href:"#cuav-v5-знято-з-виробництва","aria-label":'Permalink to "CUAV v5 (Знято з виробництва)"'},"​")],-1),m=h('<div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Цей політний контролер був <a href="./../flight_controller/autopilot_experimental.html">знятий з виробництва</a> і більше не продається комерційно.</p></div><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (або будь-який) автопілот. Звертайтесь до <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">виробника</a> щодо питань апаратного забезпечення або питань відповідності.</p></div><p><em>CUAV v5</em><sup>®</sup> (раніше &quot;Pixhack v5&quot;) - це вдосконалений автопілот, розроблений і виготовлений компанією CUAV<sup>®</sup>. Плата базується на <a href="https://pixhawk.org/" target="_blank" rel="noreferrer">Pixhawk проекті</a> відкритого апаратного забезпечення <strong>FMUv5</strong>. Він працює з PX4 на ОС <a href="https://nuttx.apache.org/" target="_blank" rel="noreferrer">NuttX</a>, і повністю сумісний з прошивкою PX4. Він призначений насамперед для академічних і комерційних розробників.</p><p><img src="'+e+'" alt="CUAV v5"></p><h2 id="короткии-опис" tabindex="-1">Короткий опис <a class="header-anchor" href="#короткии-опис" aria-label="Permalink to &quot;Короткий опис&quot;">​</a></h2><ul><li><p>Головний FMU процесор: STM32F765</p><ul><li>32 Bit Arm® Cortex®-M7, 216MHz, 2MB memory, 512KB RAM</li></ul></li><li><p>IO Processor: STM32F100</p><ul><li>32 Bit Arm®️ Cortex®️-M3, 24MHz, 8KB SRAM</li></ul></li><li><p>Бортові сенсори:</p><ul><li>Акселерометр/Гіроскоп: ICM-20689</li><li>Акселерометр/Гіроскоп: BMI055</li><li>Магнітометр: IST8310</li><li>Барометр: MS5611</li></ul></li><li><p>Інтерфейси:</p><ul><li>8-14 PWM виходів (6 з IO, 8 з FMU)</li><li>3 виділених PWM/Capture входи на FMU</li><li>Виділений R/C вхід для CPPM</li><li>Спеціалізований R/C вхід для PPM і S.Bus</li><li>аналоговий / PWM вхід RSSI</li><li>Вихід сервоприводу S.Bus</li><li>5 загальних послідовних портів</li><li>4x I2C порти</li><li>4 шини SPI</li><li>2 CANBuses з послідовними ESC</li><li>Аналогові входи для напруги / струму з 2 батарей</li></ul></li><li><p>Система живлення:</p><ul><li>Живлення: 4.3~5.4В</li><li>Вхід USB: 4.75~5.25В</li><li>Вхід сервоприводу: 0~36 В</li></ul></li><li><p>Вага та розміри:</p><ul><li>Вага: 90г</li><li>Розміри: 44x84x12мм</li></ul></li><li><p>Інші характеристики:</p><ul><li>Робоча температура: -20 ~ 80°С (виміряне значення)</li></ul></li></ul><h2 id="де-придбати" tabindex="-1">Де придбати <a class="header-anchor" href="#де-придбати" aria-label="Permalink to &quot;Де придбати&quot;">​</a></h2><p>Замовлення від <a href="https://cuav.taobao.com/index.htm?spm=2013.1.w5002-16371268426.2.411f26d9E18eAz" target="_blank" rel="noreferrer">CUAV</a>.</p><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p><img src="'+r+'" alt="CUAV v5"></p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Інтерфейс RCIN призначений лише для живлення радіоприймача і не може бути підключений до будь-якого джерела живлення/навантаження.</p></div><h2 id="номінальна-напруга" tabindex="-1">Номінальна напруга <a class="header-anchor" href="#номінальна-напруга" aria-label="Permalink to &quot;Номінальна напруга&quot;">​</a></h2><p><em>CUAV v5</em> може мати потрійну резервність у джерелі живлення, якщо подаються три джерела живлення. Три шини живлення: <strong>POWER1</strong>, <strong>POWER2</strong> і <strong>USB</strong>.</p><div class="info custom-block"><p class="custom-block-title">Вихідні шини живлення <strong>FMU PWM OUT</strong> та <strong>I/O PWM OUT</strong> (від 0В до 36В) не живлять плату контролера польоту (і не живляться від неї). Ви повинні подавати живлення на один з <strong>POWER1</strong>, <strong>POWER2</strong> або <strong>USB</strong>, інакше плата буде знеструмлена.</p></div><p><strong>Максимальна напруга нормальної роботи</strong></p><p>За таких умов всі джерела живлення будуть використовуватися в цьому порядку для живлення системи:</p><ol><li>Входи <strong>POWER1</strong> та <strong>POWER2</strong> (4,3 - 5,4 В)</li><li><strong>USB</strong> вхід (4.75В до 5.25В)</li></ol><h2 id="збірка-прошивки" tabindex="-1">Збірка прошивки <a class="header-anchor" href="#збірка-прошивки" aria-label="Permalink to &quot;Збірка прошивки&quot;">​</a></h2><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Більшості користувачів не потрібно збирати цю прошивку! Вона попередньо зібрана і автоматично встановлюється за допомогою <em>QGroundControl</em> при підключенні відповідного обладнання.</p></div><p>Щоб <a href="./../dev_setup/building_px4.html"> зібрати PX4</a> для цієї цілі:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>make px4_fmu-v5_default</span></span></code></pre></div><h2 id="відладочнии-порт" tabindex="-1">Відладочний порт <a class="header-anchor" href="#відладочнии-порт" aria-label="Permalink to &quot;Відладочний порт&quot;">​</a></h2><p><a href="./../debug/system_console.html">Системна консоль PX4</a> та <a href="./../debug/swd_debug.html">SWD interface</a> працюють на порту <strong>FMU Debug</strong>. Просто підключіть кабель FTDI до роз&#39;єму Debug &amp; F7 SWD. Щоб отримати доступ до порту відладки вводу/виводу, користувач повинен видалити оболонку CUAV v5. Обидва порти мають стандартні послідовні контакти і можуть бути підключені до стандартного кабелю FTDI (3,3 В, але допускається 5 В).</p><p>Схема підключення показана.</p><p><img src="'+l+'" alt="CUAV v5 debug"></p><table><thead><tr><th>пін</th><th>CUAV v5 debug</th></tr></thead><tbody><tr><td>1</td><td>GND</td></tr><tr><td>2</td><td>FMU-SWCLK</td></tr><tr><td>3</td><td>FMU-SWDIO</td></tr><tr><td>4</td><td>UART7_RX</td></tr><tr><td>5</td><td>UART7_TX</td></tr><tr><td>6</td><td>VCC</td></tr></tbody></table><h2 id="зіставлення-послідовних-портів" tabindex="-1">Зіставлення послідовних портів <a class="header-anchor" href="#зіставлення-послідовних-портів" aria-label="Permalink to &quot;Зіставлення послідовних портів&quot;">​</a></h2><table><thead><tr><th>UART</th><th>Пристрій</th><th>Порт</th></tr></thead><tbody><tr><td>UART1</td><td>/dev/ttyS0</td><td>GPS</td></tr><tr><td>USART2</td><td>/dev/ttyS1</td><td>TELEM1 (керування потоком)</td></tr><tr><td>USART3</td><td>/dev/ttyS2</td><td>TELEM2 (керування потоком)</td></tr><tr><td>UART4</td><td>/dev/ttyS3</td><td>TELEM4</td></tr><tr><td>USART6</td><td>/dev/ttyS4</td><td>TX - RC-вхід з роз&#39;єму SBUS_RC</td></tr><tr><td>UART7</td><td>/dev/ttyS5</td><td>Debug Console</td></tr><tr><td>UART8</td><td>/dev/ttyS6</td><td>PX4IO</td></tr></tbody></table><h2 id="периферія" tabindex="-1">Периферія <a class="header-anchor" href="#периферія" aria-label="Permalink to &quot;Периферія&quot;">​</a></h2><ul><li><a href="https://item.taobao.com/item.htm?spm=a1z10.3-c-s.w4002-16371268452.37.6d9f48afsFgGZI&amp;id=9512463037" target="_blank" rel="noreferrer">Цифровий датчик швидкості польоту</a></li><li><a href="https://cuav.taobao.com/category-158480951.htm?spm=2013.1.w5002-16371268426.4.410b7a821qYbBq&amp;search=y&amp;catName=%CA%FD%B4%AB%B5%E7%CC%A8" target="_blank" rel="noreferrer">Телеметричні радіо модулі</a></li><li><a href="./../sensor/rangefinders.html">Далекомір/Датчики відстані</a></li></ul><h2 id="supported-platforms-airframes" tabindex="-1">Supported Platforms / Airframes <a class="header-anchor" href="#supported-platforms-airframes" aria-label="Permalink to &quot;Supported Platforms / Airframes&quot;">​</a></h2><p>Будь-який мультикоптер / літак / наземна платформа чи човен, який може керуватися звичайними РК сервоприводами або сервоприводами Futaba S-Bus. Повний набір підтримуваних конфігурацій можна переглянути в <a href="./../airframes/airframe_reference.html">Довіднику авіаційних платформ</a>.</p><h2 id="подальша-інформація" tabindex="-1">Подальша інформація <a class="header-anchor" href="#подальша-інформація" aria-label="Permalink to &quot;Подальша інформація&quot;">​</a></h2><ul><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 еталонна розводка</a>.</li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5.html" target="_blank" rel="noreferrer">Документація CUAV V5</a></li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a></li></ul>',34);function g(b,f,_,v,P,k){const a=i("Badge");return p(),s("div",null,[u,d(a,{type:"info",text:"Discontinued"}),m])}const U=o(c,[["render",g]]);export{C as __pageData,U as default};
